import React from 'react';

const ChampionCard = (props) => {

    return (
        <div class="col s2">
          <div class="card">
            <div class="card-image">
              <img src={`/images/icons/${props.image}`} alt={`champion-${props.name}`} />
            </div>
          </div>
        </div>
    );
};

export default ChampionCard;
